import React, { useEffect } from "react";
import axios from "axios";
import { X } from "react-feather";
import Draggable from "react-draggable";
import { ModalContext } from "../Contexts/ModalProvider";
const api = "http://127.0.0.1:5000/";

const Modal = () => {
